import { makeStyles } from '@material-ui/core'


export default makeStyles ((theme) => ({
        root: {
          width: '95%',
          maxHeight: '100%',
          marginTop: 80,
          marginLeft: 50, 
          marginRight: 50,
          border: 5
        },
        container: {
          maxHeight: 450,
        },
        div:{
          width: '100%',
          maxHeight: '100%',
          marginTop: 70,
          marginLeft: 40, 
          marginRight: 40,
          border: 5
        }

}));
